import React from 'react';
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import { Home, Cadastro, Login } from '../src/pages';

function App() {
  return (
    <div className="App">
      <Router>
        <Switch>
          <Route path='/' component={Home} />
          <Route path='/cadas' component={Cadastro} />
          <Route path='/' component={Login} />
        </Switch>
      </Router>
    </div>
  );
}

export default App;
